import React, { useState } from 'react';
const App = ()=> {
    let newtime=new Date().toLocaleString();
    const[ctime,setCtime]=useState();

    const UpdateTime=()=>{ 
       newtime=new Date().toLocaleString();
       setCtime(newtime);
    };

return(
<>
    <h1>{ctime}</h1>
    <button onClick={UpdateTime}>Click</button>
</>
);
};
export default App;
